export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:b,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:b,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:b,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:b,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},On9AqtwwXS:{data:{id:69,attributes:{imdbId:"tt6306064",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTkxMTI2MjE4OF5BMl5BanBnXkFtZTgwMjIyODQzNTM@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"69%"},{Source:"Metacritic",Value:"56\u002F100"}],item_lang:{data:{id:732,attributes:{title:"Adrift",plot:"Starring Shailene Woodley and Sam Claflin, Adrift is based on the inspiring true story of two free spirits whose chance encounter leads them first to love, and then to the adventure of a lifetime. As the two avid sailors set out on a journey across the ocean, Tami Oldham (Woodley) and Richard Sharp (Claflin) couldn't anticipate they would be sailing directly into one of the most catastrophic hurricanes in recorded history. In the aftermath of the storm, Tami awakens to find Richard badly injured and their boat in ruins. With no hope for rescue, Tami must find the strength and determination to save herself and the only man she has ever loved. Adrift is the unforgettable story about the resilience of the human spirit and the transcendent power of love.",slug:"adrift"}}},books:{data:[{id:2024,attributes:{title:"Red Sky In Mourning",description:"New available in paperback, a true-life adventure story with everything: page-turning suspense, remarkable acts of courage, wrenching despair, and a triumphant, life-affirming ending. Red Sky in Mourning is the story of Tami Oldham Ashcraft's 41-day journey to safety, which she survived through fortitude and sheer strength of character. Interspersed with flashbacks to her romance with her doomed fiance Richard, this survival story offers an inspiring reminder that even in our darkest moments we are never truly alone.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lJHcwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,"Susea Mcgearhart"],firstBook:true,published:"2003-07-16",publisher:e,subtitle:f}},{id:2025,attributes:{title:h,description:"True, harrowing story of survival at sea when the author, then 23, was left alone aboard a 44ft. yawl when her partner was swept overboard and lost during a hurricane. One of the great stories of sea literature.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=P0o1LOBfZ9QC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,i],firstBook:d,published:"1998-01-01",publisher:"Bright Works Pub",subtitle:"The True Story of a Woman's Courage and Survival at Sea"}},{id:2026,attributes:{title:"Rest Area",description:"Clay Chapmans characters dont turn heads or perform dramatic feats of heroism. They arent highly educated or well-traveled. Their backgrounds and circumstances are unexceptional. Their stories, however, are anything but. Originating as a series of enthusiastically received monologues that this twenty-four-year-old author has performed around the country and abroad, Rest Area leads us into the minds of characters as real as they are original, and through a series of domestic horror stories that will leave readers breathless with amazement.",thumbnail:j,authors:["Clay McLeod Chapman"],firstBook:d,published:"2002-02-13",publisher:e,subtitle:j}},{id:2027,attributes:{title:"Adrift [Movie tie-in]",description:"The heart-stopping memoir, soon to be a major motion picture starring Shailene Woodley and Sam Claflin, and directed by Baltasar Kormákur (Everest). “An inspirational and empowering read.”—Shailene Woodley Young and in love, their lives ahead of them, Tami Oldham and her fiancé Richard Sharp set sail from Tahiti under brilliant blue skies, with Tami’s hometown of San Diego as their ultimate destination. But the two free spirits and avid sailors couldn’t anticipate that less than two weeks into their voyage, they would sail directly into one of the most catastrophic hurricanes in recorded history. They found themselves battling pounding rain, waves the size of skyscrapers, and 140 knot winds. Richard tethered himself to the boat and sent Tami below to safety, and then all went eerily quiet. Hours later, Tami awakened to find the boat in ruins, and Richard nowhere in sight. Adrift is the story of Tami’s miraculous forty-one-day journey to safety on a ravaged boat with no motor and no masts, and with little hope for rescue. It’s a tale of love and survival on the high seas-- an unforgettable story about resilience of the human spirit, and the transcendent power of love.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lUJ0tAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2018-05-08",publisher:"Dey Street Books",subtitle:f}},{id:2028,attributes:{title:h,description:"In a true-life story of adventure and survival, the author describes how a sailing trip with her fiancT turned to tragedy after they inadvertently sailed into a hurricane that left her injured and her fiancT swept overboard and her forty-one-day ordeal traveling to safety, without a motor or masts. 40,000 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ffMJAQAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c,i],firstBook:d,published:"2002-06-12",publisher:e,subtitle:f}}]}}},meta:{}}},prerenderedAt:1694069419733}}("movie","series","Tami Oldham Ashcraft",null,"Hyperion","A True Story of Love, Loss, and Survival at Sea",1,"Red Sky in Mourning","Susea McGearhart",""))